import { Carousel, Col, Container, Row } from "react-bootstrap";
import item1 from '../Images/Homepack/Corsoler1.jpg';
function Home(){
    return(
        <>
            <Container>
                <Row>
                    <Col xs={12} md={12}>
                        <Carousel>
                            <Carousel.Item interval={1000}>
                                <img src={item1} className="fluid" alt="item 1"/>
                                <Carousel.Caption>
                                    Number 1 Choice In everywhere.
                                </Carousel.Caption>
                            </Carousel.Item>
                        </Carousel>
                    </Col>
                </Row>
            </Container>
        </>
    );
}

export default Home;
